<script>
const _originalFetch = window.fetch;

window.fetch = (url, options = {}) => new Promise(
    function (resolve, reject) {
        if (url.endsWith('FontManifest.json')) {
            resolve(new Response(
                "[]",
                {
                    status: 200,
                    statusText: 'OK',
                    headers: {
                        'Content-Type': 'application/json',
                    },
                }
            ));
            return;
        }

        _originalFetch(url, options);
    },
);
</script>
<script>
window.history = window.history || {};
window.history.replaceState = (stateObj, title, url) => undefined;
window.history.pushState = (stateObj, title, url) => undefined;
</script>
<script>
globalThis.postMessage = (method, data) => parent.postMessage(
    { pluginMessage: { method, data } }, '*'
);

window.onmessage = (event) => { 
    const message = event.data.pluginMessage;
    globalThis.onMessage({method: message.method, data: message.data}); 
};
</script>
